  return (

    <div className="App">
    <Router>
    <Navbar />
    <Route exact path="/">

    <Corousel />
    <RecomVendor/>
    {/* <SideDrawer show={sideToggle} click={() => setSideToggle(false)} /> */}

       {/* Navbar*/}
       {/* {Sidedrawer} */}
       {/* {Backdrop} */}
       {/* Home Screen */}
       {/* Vendor List */}
       {/* Cart and Checkout Screen*/}  
    </Route> 
    {/* <Switch> */}

    <Route exact path="/vendors" component={Vendor} />
    <Route exact path="/foods/:id" component={Vendordetail} />
    <Route exact path="/foods" component={Food} /> 
     <Route exact path="/ordersummary" component={Ordersummary} />

    {/* </Switch> */}
    </Router> 


    </div>
  );
}

export default App;
